import axios from 'axios';

const KEY = "364a2dfb8440a8270973815ff49261c0";

export default axios.create({
    baseURL: 'https://api.themoviedb.org/3',
    params: {
        language: 'en-US',
        page: 1,
        include_adult: false,
        key: KEY
    },
    headers: {
        'Content-Type': 'application/json'
    }
});
